import './App.css';
import React, { Component } from 'react';

class App extends Component {
	render() {
		const title = 'GitHub User Finder';
		const loading = false;

		return (
			<>
				<div className='App'>
					{loading ? <h4>loading...</h4> : <h1>{title}</h1>}
				</div>
			</>
		);
	}
}
export default App;
